  false,\n\t\"url\": null,\n\t\"notes\": \"This table represents details of Prenatal
  Care Services program. Prenatal Care Services through Medicaid is a comprehensive
  prenatal care program that offers complete pregnancy care and other health services
  to women and teens who live in New York State and meet income guidelines. Health
  insurance is available for pregnant women regardless of their immigration status.
  Under Prenatal Care Services, pregnant women receive prenatal health services, such
  as lab tests, HIV tests, nutrition screenings, and other services related to their
  pregnancy and for at least two months after delivery.  Babies receive health care
  services for at least one year after birth.\",\n\t\"license_title\": \"License Not
